// import React from 'react';
import LoadingComponent from '../components/ComponentLoading';
import Loadable from 'react-loadable';

const HomeRouter = Loadable({
  loader: () => import('./HomeRouter'),
  loading: LoadingComponent
});
const LoginPage = Loadable({
  loader: () => import('layouts/LoginPage'),
  loading: LoadingComponent
});
const StudioPage = Loadable({
  loader: () => import('layouts/ZCloudDevice'),
  loading: LoadingComponent
});
const StudioDevice = Loadable({
  loader: () => import('layouts/ZDeviceMonitor'),
  loading: LoadingComponent
});
const ZWordView = Loadable({
  loader: () => import('layouts/ZWordView'),
  loading: LoadingComponent
});

export {
  HomeRouter,
  LoginPage,
  StudioPage,
  StudioDevice,
  ZWordView
};
